import React from "react";
import "./App.css";
import Header from "./component/header/Header";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <div className="app">
      <Router>
        <Header />
      </Router>
    </div>
  );
}

export default App;
